import React from "react";
import { BrowserRouter, Switch, Link, Route } from "react-router-dom";
import Home from "./core/Home";

function Routes() {
	return (
		<BrowserRouter>
			<Switch>
				<Route path="/" exact component={Home} />
			</Switch>
		</BrowserRouter>
	);
}

export default Routes;
